import React from "react";
import ReactDOM from "react-dom/client";
import DataSet from "./DataSet";

const columns = [{ key: "name", label: "Имя" }, { key: "age", label: "Возраст" }];
const data = [{ name: "Иван", age: 30 }, { name: "Анна", age: 25 }];

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <DataSet
      columns={columns}
      data={data}
      renderRow={(row, col) => row[col.key]}
      renderHeader={(col) => col.label}
    />
  </React.StrictMode>
);
